import PropTypes from "prop-types";
function PropsValidate(props){
    const{name, age}=props;
    return(
        <>
        <h2>Name:{name}</h2>
        <h2>Age:{age}</h2>
        <h2>After 5 years my age will be:{age+5}</h2>
        </>
    );

}

PropsValidate.PropTypes={
    name:PropTypes.string,
    age:PropTypes.number.isRequired
}
